const { performance, PerformanceObserver } = require("perf_hooks");

const rawInput = ``;

const input = rawInput.split("");

const obs = new PerformanceObserver(items => {
  console.log(items.getEntries()[0].duration);
  performance.clearMarks();
});
obs.observe({ entryTypes: ["measure"] });
performance.mark("begin");
// 1
function removePolarities(inputs) {
  const newInput = [];
  let i = 0;
  while (i < inputs.length) {
    if (i >= inputs.length - 1) {
      newInput.push(inputs[i]);
      break;
    }
    const curr = inputs[i];
    const prev = inputs[i + 1];
    if (curr.toLowerCase() !== prev.toLowerCase() || curr === prev) {
      newInput.push(curr);
    } else {
      i = i + 1;
    }
    i = i + 1;
  }
  return newInput;
}

let prevLength = input.length;
let newInput = removePolarities(input);
let newLength = newInput.length;
while (newLength !== prevLength) {
  prevLength = newLength;
  newInput = removePolarities(newInput);
  newLength = newInput.length;
}

performance.mark("end");
performance.measure("algorithm", "begin", "end");
console.log("solution 1: ", newLength);

